s($,"bpy","b3y",()=>A.b([A.a9("\uc721\uc544\ub09c\uc774\ub3c4",1,"\ud83d\ude08 \ub9e4\uc6b4\ub9db","\ud83d\udc7c \uc21c\ud55c\ub9db","\uc624\ub298 \uc721\uc544 \ub09c\uc774\ub3c4\ub294 \uc5b4\ub560\ub098\uc694?","\uac00\uc7a5 \ud798\ub4e4\uac8c \ud588\ub358 \uc21c\uac04\uc740 \uc5b8\uc81c\uc778\uac00\uc694?","\uc544\uc774\uac00 \uc608\ubed0 \ubcf4\uc600\ub358 \uacb0\uc815\uc801 \uc21c\uac04\uc740?"),A.a9("\ub0b4 \uccb4\ub825",2,"\ud83e\udddf\u200d\u2642\ufe0f \uc880\ube44 \ubaa8\ub4dc","\ud83d\udcaa \uc288\ud37c\ub9e8/\uc6b0\uba3c","\ub098\uc758 \ud604\uc7ac \uccb4\ub825 \uc0c1\ud0dc\ub294?","\uc9c0\uae08 \ub2f9\uc7a5 \uc218\ud608\uc774 \ud544\uc694\ud55c \uac83\uc740? (\ucee4\ud53c/\uc7a0 \ub4f1)","\ub0a8\uc740 \uccb4\ub825\uc73c\ub85c \uc544\uc774\uc640 \ubb34\uc5c7\uc744 \ub354 \ud558\uace0 \uc2f6\ub098\uc694?"),A.a9("\uc544\uc774 \uae30\ubd84",3,"\u2601\ufe0f \ud750\ub9bc/\ub5bc\uc7c1\uc774","\u2600\ufe0f \ub9d1\uc74c/\ucc9c\uc0ac","\uc624\ub298 \uc544\uc774\uc758 \ud150\uc158\uc740?","\ubb34\uc5c7\uc774 \uc544\uc774\ub97c \uc18d\uc0c1\ud558\uac8c \ub9cc\ub4e4\uc5c8\ub098\uc694?","\uc544\uc774\ub97c \uae4c\ub974\ub974 \uc6c3\uac8c \ub9cc\ub4e0 \ud589\ub3d9\uc740?"),A.a9("\uc624\ub298\uc758 \ub0b4 \ud3b8",4,"\ud83d\udc75 \uc721\uc544 \ub9cc\ub819 \ud560\uba38\ub2c8","\ud83d\udc69\u200d\u2695\ufe0f \uc721\uc544 \uba58\ud1a0 \ubc15\uc0ac\ub2d8","\uc624\ub298 \ub204\uad6c\uc758 \uc704\ub85c\uac00 \ud544\uc694\ud55c\uac00\uc694?","","")],t.Y))
